import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 18.2-268.8 Fees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-268.8.md","filePath":"vacode/18.2-268.8.md"}'),i={name:"vacode/18.2-268.8.md"},o=t('<h1 id="§-18-2-268-8-fees" tabindex="-1">§ 18.2-268.8 Fees. <a class="header-anchor" href="#§-18-2-268-8-fees" aria-label="Permalink to &quot;§ 18.2-268.8 Fees.&quot;">​</a></h1><p>Payment for withdrawing blood shall not exceed $25, which shall be paid out of the appropriation for criminal charges. If the person whose blood sample was withdrawn is subsequently convicted for a violation of § <a href="http://law.lis.virginia.gov/vacode/18.2-266/" target="_blank" rel="noreferrer">18.2-266</a>, <a href="http://law.lis.virginia.gov/vacode/18.2-266.1/" target="_blank" rel="noreferrer">18.2-266.1</a>, or subsection B of § <a href="http://law.lis.virginia.gov/vacode/18.2-272/" target="_blank" rel="noreferrer">18.2-272</a> or of a similar ordinance, or is placed under the purview of a probational, educational, or rehabilitational program as set forth in § <a href="http://law.lis.virginia.gov/vacode/18.2-271.1/" target="_blank" rel="noreferrer">18.2-271.1</a>, the amount charged by the person withdrawing the sample shall be taxed as part of the costs of the criminal case and shall be paid into the general fund of the state treasury.</p><p>If the person whose blood sample was withdrawn is subsequently convicted for violation of § <a href="http://law.lis.virginia.gov/vacode/18.2-266/" target="_blank" rel="noreferrer">18.2-266</a>, <a href="http://law.lis.virginia.gov/vacode/18.2-266.1/" target="_blank" rel="noreferrer">18.2-266.1</a>, or subsection B of § <a href="http://law.lis.virginia.gov/vacode/18.2-272/" target="_blank" rel="noreferrer">18.2-272</a> or a similar ordinance, a fee of $25 for testing the first blood sample by the Department shall be taxed as part of the costs of the criminal case and shall be paid into the general fund of the state treasury.</p><p>1992, c. 830; 1994, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0359" target="_blank" rel="noreferrer">359</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0363" target="_blank" rel="noreferrer">363</a>; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0561" target="_blank" rel="noreferrer">561</a>; 2003, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0933" target="_blank" rel="noreferrer">933</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0936" target="_blank" rel="noreferrer">936</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP1013" target="_blank" rel="noreferrer">1013</a>; 2005, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0757" target="_blank" rel="noreferrer">757</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0840" target="_blank" rel="noreferrer">840</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0868" target="_blank" rel="noreferrer">868</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0881" target="_blank" rel="noreferrer">881</a>.</p>',4),l=[o];function n(s,f,g,h,c,p){return r(),a("div",null,l)}const _=e(i,[["render",n]]);export{v as __pageData,_ as default};
